response.about:
Когда увидишь в Смольном человека, 
На коем френч; 
Чей взгляд туманней сонного Казбека; 
Несвязна речь; 
Кого власы в кудрявом беспорядке; 
Кто, говоря, 
Жестикулирует во творческом припадке 
Знай: это я! 
Тот, кто язвит с сатирой вечно новой, 
Из года в год; 
С кого судьба венец его картонный 
С усмешкой рвет; 
Кто ни перед кем главы не склонит гордой, — 
Знай: это я! 
В моих устах лишь скромная улыбка, 
Зато в груди — змея!
__________________________________________

А еще я - тюлень. Тюлень без причины и идеала.
